#include "hls_stream.h"
#include "ap_fixed.h"

// Define the data types
typedef ap_fixed<8,2> fixed_type;
typedef hls::stream<fixed_type> stream_type;

// Define the linear layer function
void linear_layer(stream_type& input_stream, fixed_type weight[], fixed_type bias[], stream_type& output_stream) {
    // Set the number of input and output values
    const int N = 1024;

    // Perform the linear layer computation
    for(int i = 0; i < N; i++) {
        fixed_type input_value = input_stream.read();
        fixed_type weighted_sum = 0;
        for(int j = 0; j < N; j++) {
            weighted_sum += input_value * weight[i * N + j];
        }
        fixed_type output_value = weighted_sum + bias[i];
        output_stream.write(output_value);
    }
}

// Define the RELU function
void relu(stream_type& input_stream, stream_type& output_stream) {
    const int N = 1024;
    for(int i = 0; i < N; i++) {
        fixed_type input_value = input_stream.read();
        fixed_type output_value = input_value > 0 ? input_value : 0;
        output_stream.write(output_value);
    }
}

// Top-level function for the accelerator
void linear_accelerator(stream_type& input_stream, fixed_type weight[], fixed_type bias[], stream_type& output_stream) {
    #pragma HLS INTERFACE axis port=input_stream
    #pragma HLS INTERFACE axis port=output_stream
    #pragma HLS INTERFACE m_axi port=weight offset=slave bundle=gmem
    #pragma HLS INTERFACE m_axi port=bias offset=slave bundle=gmem

    // Create intermediate streams
    stream_type linear_output_stream;
    stream_type relu_output_stream;

    // Call the linear layer function
    linear_layer(input_stream, weight, bias, linear_output_stream);

    // Call the RELU function
    relu(linear_output_stream, relu_output_stream);

    // Write the output to the output stream
    const int N = 1024;
    for(int i = 0; i < N; i++) {
        fixed_type output_value = relu_output_stream.read();
        output_stream.write(output_value);
    }
}
```

